import { Typography } from "@material-ui/core";
const LoginTopTitle = (props) => {
  return (
    <>
      <Typography className="mt-4 mb-4 login_title" variant="h3">
        {props.title}
      </Typography>
    </>
  );
};
export default LoginTopTitle;
